import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="titleContainer">
          <div className="title">
            <p className="titleText">{'Toggle'}</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
